namespace PhpOffice\PhpWord\Element;

use PhpOffice\PhpWord\Shared\String;

/**
 * Check box element
 *
 * @since 0.10.0
 */
class CheckBox extends Text
{
    /**
     * Name content
     *
     * @var string
     */
